import React from 'react'
import background from '../Assets/bd1.png'

function Contact() {
  return (
    <div style={{ backgroundImage: `url(${background})` }} className='pt-[55px]'>
        <div className='bg-form_bg'> 
            <h1>Contact Us</h1>
        </div>
    </div>
  )
}

export default Contact
